    return (
    <div className={classes.header}>
        <header>
            <h1>ReactMeals</h1>
            <button>Cart</button>
            <img className={classes['.main-image']} src={MealImage} alt='a table full of delicious food' /> 
            </header>
        <Cart/>
    </div>
    )}

export default Header;
